import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Button } from "../components/ui/button";

const Landing = () => {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      <div className="bg-white p-8 rounded shadow-md w-full max-w-md space-y-4">
        <h1 className="text-3xl font-bold text-center">TradeQuote</h1>
        <p className="text-center text-gray-500">Welcome,</p>
        <Button className="w-full bg-blue-700 hover:bg-blue-800" onClick={() => navigate('/new-quote')}>New Quote</Button>
        <Button className="w-full bg-green-700 hover:bg-green-800" onClick={() => navigate('/saved-quotes')}>Saved Quotes</Button>
        <Button className="w-full bg-purple-700 hover:bg-purple-800" onClick={() => navigate('/reports')}>Reports</Button>
        <Button className="w-full bg-yellow-600 hover:bg-yellow-700" onClick={() => navigate('/settings')}>Settings</Button>
        <Button className="w-full bg-red-700 hover:bg-red-800" onClick={() => {
          localStorage.removeItem("user");
          window.location.href = "/";
        }}>Log Out</Button>
      </div>
    </div>
  );
};

export default Landing;
